import styled from "styled-components";

export const StyledFooter = styled.div`
    background-color: ${({theme})=> theme.colors.footer};
    color: #fff;
    padding: 140px 0 60px;

    ul {
        list-style-type: none;
    }
    
    ul li{
        margin-bottom: 20px;
    }

    p{
        text-align: right;
    }
`
